import logo from './logo.svg';
import './App.css';

import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate
} from "react-router-dom";

import Principal from './pages/principal.js'
import catVideojuego from './pages/categorias/Videojuegos'


function App() {
  return (
    <Router>
    <div className="App">
      <Routes>
        <Route path="/" element={<Navigate to="/principal"/>}/>
        <Route path="/principal" element={<Principal/>}/>
        <Route path="/videojuegos" element={<catVideojuego/>}/>
      </Routes>
    </div>
    </Router>

  );
}

export default App;
